import React, { Component } from 'react';
import Prism from "prismjs"
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import '../../ReactJs/styles.css'
import Sidebar from '../sidebar';
import PrismCode from '../../ReactJs/prismCode';

import Stcksval from '../../../assets/stcks.png';

const titles = { backgroundColor: '#F0F8FF', padding: '1px', fontSize: '16px' }

const redesign = {
  height: 200,
  width: 500
}

const styles = theme => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1)
  },
  smMargin: {
    margin: theme.spacing(1)
  },
  actionDiv: {
    textAlign: "center"
  }
})




const longestCommonPrefix = `
const longestCommonPrefix = (strs = []) => {
  let prefix = ''
  let minLength = strs.reduce(
    (acc, str) => (acc < str.length ? acc : str.length), Infinity,
  )
  minLength = minLength === Infinity ? 0 : minLength
  for (let i = 0; i < minLength; i++) {
    const current = strs[0][i]
    const isSame = strs.every(str => str[i] === current)
    if (isSame) {
      prefix += current
    } else {
      return prefix
    }
  }
  return prefix
}`.trim();

const threeSum = `
const threeSum = function (nums) {
  nums.sort((a, b) => a - b)
  const result = []
  for (let i = 0; i < nums.length; i++) {
    if (nums[i] === nums[i - 1]) {
      continue
    }
    let left = i + 1
    let right = nums.length - 1
    while (left < right) {
      if (left > i + 1 && nums[left] === nums[left - 1]) {
        left += 1
        continue
      }
      const sum = nums[left] + nums[right] + nums[i]
      if (sum === 0) {
        result.push([nums[i], nums[left], nums[right]])
        left += 1
        right -= 1
      } else if (sum > 0) {
        right -= 1
      } else {
        left += 1
      }
    }
  }
  return result
}


console.log(threeSum([-1,0,1,2,-1,-4]))`.trim();

const threeSumClosest = `
const threeSumClosest = function (nums, target) {
  let diff = Infinity
  let result = 0
  nums.sort((a, b) => a - b)
  for (let i = 0; i < nums.length; i++) {
    let left = i + 1
    let right = nums.length - 1
    while (left < right) {
      const sum = nums[i] + nums[left] + nums[right]
      const currentDiff = sum - target
      if (currentDiff > 0) {
        right -= 1
      } else {
        left += 1
      }
      if (Math.abs(currentDiff) < diff) {
        result = sum
      }
      diff = Math.min(Math.abs(currentDiff), diff)
    }
  }
  return result
}

console.log(threeSumClosest([-1,2,1,-4]))`.trim();

const letterCombinations = `
const letterCombinations = (digits = '') => {
  const map = {
    2: ['a', 'b', 'c'],
    3: ['d', 'e', 'f'],
    4: ['g', 'h', 'i'],
    5: ['j', 'k', 'l'],
    6: ['m', 'n', 'o'],
    7: ['p', 'q', 'r', 's'],
    8: ['t', 'u', 'v'],
    9: ['w', 'x', 'y', 'z'],
  }
  if (!digits.length) {
    return []
  }
  let result = ['']
  let index = 0
  while (index < digits.length) {
    const next = map[digits[index]]
    const nextResult = []
    for (let i = 0; i < result.length; i++) {
      for (let j = 0; j < next.length; j++) {
        nextResult.push(result[i] + next[j])
      }
    }
    result = nextResult
    index++
  }
  return result
}

console.log(letterCombinations("23"))`.trim();

const removeNthFromEnd = `
const removeNthFromEnd = (head, n) => {
  let h1 = head
  let h2 = null
  let count = 0
  while (h1) {
    count += 1
    h1 = h1.next
    if (h2) {
      h2 = h2.next
    }
    if (count === n + 1) {
      h2 = head
    }
  }
  if (!h2) {
    return head ? head.next : null
  }
  h2.next = h2.next.next
  return head
}`.trim();

const isValid = `
const isValid = function (s) {
  const stack = []
  const pair = {
    '[': ']',
    '{': '}',
    '(': ')',
  }
  const isPaired = (a, b) => pair[a] === b

  for (c of s) {
    if (isPaired(stack[stack.length - 1], c)) {
      stack.pop()
    } else {
      stack.push(c)
    }
  }
  return stack.length === 0
}

console.log(isValid("()"))`.trim();

const mergeTwoLists = `
const mergeTwoLists = (l1, l2) => {
  const aux = (current1, current2, acc) => {
    if (!current1) {
      acc.next = current2
      return acc
    }
    if (!current2) {
      acc.next = current1
      return acc
    }
    if (current1.val < current2.val) {
      acc.next = {
        val: current1.val,
        next: null,
      }
      return aux(current1.next, current2, acc.next)
    }
    acc.next = {
      val: current2.val,
      next: null,
    }
    return aux(current2.next, current1, acc.next)
  }
  const head = { val: null, next: null }
  aux(l1, l2, head)
    return head.next
}`.trim();

const generateParenthesis = `
const generateParenthesis = function (n) {
  const result = []
  const aux = (current, left, right) => {
    if (left === n && right === n) {
      result.push(current)
      return
    }
    if (left < right || left > n || right > n) {
      return
    }
    aux('$'{current}(', left + 1, right)
    aux('$'{current})', left, right + 1)
  }
  aux('', 0, 0)
  return result
}
`.trim();

const swap = `const swap = (a, b, arr) => { // eslint-disable-line
  if (a !== b) {
    const temp = arr[a]
    arr[a] = arr[b] // eslint-disable-line
    arr[b] = temp // eslint-disable-line
  }
}

const Heap = compareFn => (arr = []) => {
  const left = index => 2 * index + 1
  const right = index => 2 * index + 2
  const parent = index => Math.floor((index - 1) / 2)
  const size = () => arr.length

  // log(n)
  const heapify = (index) => {
    const l = left(index)
    const r = right(index)
    let current = index
    if ((l < size()) && compareFn(arr[current], arr[l]) > 0) {
      current = l
    }
    if ((r < size()) && compareFn(arr[current], arr[r]) > 0) {
      current = r
    }
    if (current !== index) {
      swap(current, index, arr)
      heapify(current)
    }
  }
  // log(n)
  const heapifyUp = (index) => {
    const p = parent(index)
    if (p >= 0 && compareFn(arr[p], arr[index]) > 0) {
      swap(p, index, arr)
      heapifyUp(p)
    }
  }
  // O(n)
  const buildHeap = () => {
    for (let i = Math.floor(arr.length / 2); i >= 0; i--) {
      heapify(i)
    }
  }
  const extract = () => {
    swap(0, arr.length - 1, arr)
    const top = arr.pop()
    heapify(0)
    return top
  }
  const remove = (item) => {
    const index = arr.findIndex(x => compareFn(x, item) === 0)
    if (index === -1) {
      return
    }
    arr[index] = arr.pop() // eslint-disable-line
    const p = parent(index)
    if (p < 0 || compareFn(p, arr[index]) < 0) {
      heapify(index)
    } else {
      heapifyUp(index)
    }
  }
  buildHeap()
  return {
    getHeap: () => arr,
    peek: () => {
      if (arr.length === 0) {
        return null
      }
      return arr[0]
    },
    add: (item) => {
      arr.push(item)
      heapifyUp(arr.length - 1)
    },
    extract,
    remove,
    size,
  }
}

const mergeKLists = (lists = []) => {
  const minHeap = Heap((a, b) => a.val - b.val)([])
  lists.forEach((node) => {
    if (node) {
      minHeap.add(node)
    }
  })
  const head = minHeap.extract() || null
  let current = head
  while (minHeap.size() > 0) {
      console.log(minHeap.size())
    if (current.next) {
      minHeap.add(current.next)
    }
    current.next = minHeap.extract()
    current = current.next
  }
  return head
}


console.log(swap([[1,4,5],[1,3,4],[2,6]]))`.trim();


