Notice that the solution set must not contain duplicate triplets.<br/>



Example 1:<br/>

Input: nums = [-1,0,1,2,-1,-4]<br/>
Output: [[-1,-1,2],[-1,0,1]]<br/><br/>
Example 2:<br/>

Input: nums = []<br/>
Output: []

              <div style={titles}>
                <PrismCode
                  code={threeSum}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>2. 3Sum Closest</h3>
              Given an array nums of n integers and an integer target, find three integers in nums such that the sum is closest to target. Return the sum of the three integers. You may assume that each input would have exactly one solution.
              <br/>
Example 1:<br/>

Input: nums = [-1,2,1,-4], target = 1<br/>
Output: 2<br/>
Explanation: The sum that is closest to the target is 2. (-1 + 2 + 1 = 2).
              <div style={titles}>
                <PrismCode
                  code={threeSumClosest}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>3. Letter Combinations of a Phone Number.</h3>
              Given a string containing digits from 2-9 inclusive, return all possible letter combinations that the number could represent.
              <br/><br/>
A mapping of digit to letters (just like on the telephone buttons) is given below. Note that 1 does not map to any letters.<br/><br/>
Example:<br/>

Input: "23"<br/>
Output: ["ad", "ae", "af", "bd", "be", "bf", "cd", "ce", "cf"].
              <div style={titles}>
                <PrismCode
                  code={letterCombinations}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>4. Remove Nth Node From End of List</h3>
              <div style={titles}>
                <PrismCode
                  code={removeNthFromEnd}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>5. Valid Parentheses</h3>
              Given a string s containing just the characters '(', ')', '{', '}', '[' and ']', determine if the input string is valid.
              <br/>
An input string is valid if:<br/>

Open brackets must be closed by the same type of brackets.<br/>
Open brackets must be closed in the correct order.<br/><br/>

Example 1:<br/>

Input: s = "()"<br/>
Output: true<br/><br/>
Example 2:<br/>

Input: s = "()[]{}"<br/>
Output: true<br/><br/>
Example 3:<br/>

Input: s = "(]"<br/>
Output: false
              <div style={titles}>
                <PrismCode
                  code={isValid}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
