              <br/>
For example, given n = 3, a solution set is: <br/>

[
  "((()))", <br/>
  "(()())", <br/>
  "(())()", <br/>
  "()(())", <br/>
  "()()()" <br/>
]
              <div style={titles}>
                <PrismCode
                  code={generateParenthesis}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>8. Merge k Sorted Lists.</h3>
